import React from "react";
import Nav from '../components/navbar';
import Foot from '../components/footer';

function Contact() {
  return (
    <div id="wrapper">
      <Nav />
      <div id="contactwrapper">

      </div>
      <h2 >Contact US</h2>
      <Foot />
      <style jsx>{`
        body {
          margin: 0;
        }
        #wrapper {
          float: left;
          margin: 0;
          width: 100%;
        }
        h2 {
          float: left;
          display: block;
        }
        `}</style>
    </div>

  );
}

export default Contact;
